import React from "react";
import "./ServicesCards.css";

function ServicesCards() {
    return (
        <div className="service-cards">
            <h1>Services</h1>
            <div className="cards-container">
                <div className="card-one"></div>
            </div>
        </div>
    )
}

export default ServicesCards;
